def to_dict(self, orient='dict', into=dict):
    """
    Convert the DataFrame to a dictionary.

    The type of the key-value pairs can be customized with the parameters
    (see below).

    Parameters
    ----------
    orient : str {'dict', 'list', 'series', 'split', 'records', 'index'}
        Determines the type of the values of the dictionary.

        - 'dict' (default) : dict like {column -> {index -> value}}
        - 'list' : dict like {column -> [values]}
        - 'series' : dict like {column -> Series(values)}
        - 'split' : dict like
          {'index' -> [index], 'columns' -> [columns], 'data' -> [values]}
        - 'records' : list like
          [{column -> value}, ... , {column -> value}]
        - 'index' : dict like {index -> {column -> value}}

        Abbreviations are allowed. `s` indicates `series` and `sp`
        indicates `split`.

    into : class, default dict
        The collections.abc.Mapping subclass used for all Mappings
        in the return value.  Can be the actual class or an empty
        instance of the mapping type you want.  If you want a
        collections.defaultdict, you must pass it initialized.

    Returns
    -------
    dict, list or collections.abc.Mapping
        Return a collections.abc.Mapping object representing the DataFrame.
        The resulting transformation depends on the `orient` parameter.

    See Also
    --------
    DataFrame.from_dict: Create a DataFrame from a dictionary.
    DataFrame.to_json: Convert a DataFrame to JSON format.

    Examples
    --------
    >>> df = pd.DataFrame({'col1': [1, 2],
    ...                    'col2': [0.5, 0.75]},
    ...                   index=['row1', 'row2'])
    >>> df
          col1  col2
    row1     1  0.50
    row2     2  0.75
    >>> df.to_dict()
    {'col1': {'row1': 1, 'row2': 2}, 'col2': {'row1': 0.5, 'row2': 0.75}}

    You can specify the return orientation.

    >>> df.to_dict('series')
    {'col1': row1    1
             row2    2
    Name: col1, dtype: int64,
    'col2': row1    0.50
            row2    0.75
    Name: col2, dtype: float64}

    >>> df.to_dict('split')
    {'index': ['row1', 'row2'], 'columns': ['col1', 'col2'],
     'data': [[1, 0.5], [2, 0.75]]}

    >>> df.to_dict('records')
    [{'col1': 1, 'col2': 0.5}, {'col1': 2, 'col2': 0.75}]

    >>> df.to_dict('index')
    {'row1': {'col1': 1, 'col2': 0.5}, 'row2': {'col1': 2, 'col2': 0.75}}

    You can also specify the mapping type.

    >>> from collections import OrderedDict, defaultdict
    >>> df.to_dict(into=OrderedDict)
    OrderedDict([('col1', OrderedDict([('row1', 1), ('row2', 2)])),
                 ('col2', OrderedDict([('row1', 0.5), ('row2', 0.75)]))])

    If you want a `defaultdict`, you need to initialize it:

    >>> dd = defaultdict(list)
    >>> df.to_dict('records', into=dd)
    [defaultdict(<class 'list'>, {'col1': 1, 'col2': 0.5}),
     defaultdict(<class 'list'>, {'col1': 2, 'col2': 0.75})]
    """
    if not self.columns.is_unique:
        warnings.warn('DataFrame columns are not unique, some columns will be omitted.', UserWarning, stacklevel=2)
    into_c = com.standardize_mapping(into)
    orient = orient.lower()
    if orient.startswith(('d', 'l', 's', 'r', 'i')) and orient not in {'dict', 'list', 'series', 'split', 'records', 'index'}:
        warnings.warn("Using short name for 'orient' is deprecated. Only the options: ('dict', list, 'series', 'split', 'records', 'index') will be used in a future version. Use one of the above to silence this warning.", FutureWarning)
        if orient.startswith('d'):
            orient = 'dict'
        elif orient.startswith('l'):
            orient = 'list'
        elif orient.startswith('sp'):
            orient = 'split'
        elif orient.startswith('s'):
            orient = 'series'
        elif orient.startswith('r'):
            orient = 'records'
        elif orient.startswith('i'):
            orient = 'index'
    if orient == 'dict':
        return into_c(((k, v.to_dict(into)) for k, v in self.items()))
    elif orient == 'list':
        return into_c(((k, v.tolist()) for k, v in self.items()))
    elif orient == 'split':
        return into_c((('index', self.index.tolist()), ('columns', self.columns.tolist()), ('data', [list(map(com.maybe_box_datetimelike, t)) for t in self.itertuples(index=False, name=None)])))
    elif orient == 'series':
        return into_c(((k, com.maybe_box_datetimelike(v)) for k, v in self.items()))
    elif orient == 'records':
        columns = self.columns.tolist()
        rows = (dict(zip(columns, row)) for row in self.itertuples(index=False, name=None))
        return [into_c(((k, com.maybe_box_datetimelike(v)) for k, v in row.items())) for row in rows]
    elif orient == 'index':
        if not self.index.is_unique:
            raise ValueError("DataFrame index must be unique for orient='index'.")
        return into_c(((t[0], dict(zip(self.columns, t[1:]))) for t in self.itertuples(name=None)))
    else:
        raise ValueError(f"orient '{orient}' not understood")

@classmethod
def from_records(cls, data, index=None, exclude=None, columns=None, coerce_float=False, nrows=None) -> 'DataFrame':
    """
    Convert structured or record ndarray to DataFrame.

    Parameters
    ----------
    data : ndarray (structured dtype), list of tuples, dict, or DataFrame
    index : str, list of fields, array-like
        Field of array to use as the index, alternately a specific set of
        input labels to use.
    exclude : sequence, default None
        Columns or fields to exclude.
    columns : sequence, default None
        Column names to use. If the passed data do not have names
        associated with them, this argument provides names for the
        columns. Otherwise this argument indicates the order of the columns
        in the result (any names not found in the data will become all-NA
        columns).
    coerce_float : bool, default False
        Attempt to convert values of non-string, non-numeric objects (like
        decimal.Decimal) to floating point, useful for SQL result sets.
    nrows : int, default None
        Number of rows to read if data is an iterator.

    Returns
    -------
    DataFrame
    """
    if columns is not None:
        columns = ensure_index(columns)
    if is_iterator(data):
        if nrows == 0:
            return cls()
        try:
            first_row = next(data)
        except StopIteration:
            return cls(index=index, columns=columns)
        dtype = None
        if hasattr(first_row, 'dtype') and first_row.dtype.names:
            dtype = first_row.dtype
        values = [first_row]
        if nrows is None:
            values += data
        else:
            values.extend(itertools.islice(data, nrows - 1))
        if dtype is not None:
            data = np.array(values, dtype=dtype)
        else:
            data = values
    if isinstance(data, dict):
        if columns is None:
            columns = arr_columns = ensure_index(sorted(data))
            arrays = [data[k] for k in columns]
        else:
            arrays = []
            arr_columns = []
            for k, v in data.items():
                if k in columns:
                    arr_columns.append(k)
                    arrays.append(v)
            arrays, arr_columns = reorder_arrays(arrays, arr_columns, columns)
    elif isinstance(data, (np.ndarray, DataFrame)):
        arrays, columns = to_arrays(data, columns)
        if columns is not None:
            columns = ensure_index(columns)
        arr_columns = columns
    else:
        arrays, arr_columns = to_arrays(data, columns, coerce_float=coerce_float)
        arr_columns = ensure_index(arr_columns)
        if columns is not None:
            columns = ensure_index(columns)
        else:
            columns = arr_columns
    if exclude is None:
        exclude = set()
    else:
        exclude = set(exclude)
    result_index = None
    if index is not None:
        if isinstance(index, str) or not hasattr(index, '__iter__'):
            i = columns.get_loc(index)
            exclude.add(index)
            if len(arrays) > 0:
                result_index = Index(arrays[i], name=index)
            else:
                result_index = Index([], name=index)
        else:
            try:
                index_data = [arrays[arr_columns.get_loc(field)] for field in index]
            except (KeyError, TypeError):
                result_index = index
            else:
                result_index = ensure_index_from_sequences(index_data, names=index)
                exclude.update(index)
    if any(exclude):
        arr_exclude = [x for x in exclude if x in arr_columns]
        to_remove = [arr_columns.get_loc(col) for col in arr_exclude]
        arrays = [v for i, v in enumerate(arrays) if i not in to_remove]
        arr_columns = arr_columns.drop(arr_exclude)
        columns = columns.drop(exclude)
    mgr = arrays_to_mgr(arrays, arr_columns, result_index, columns)
    return cls(mgr)

