        _arith_op = func
    else:

        def _arith_op(left, right):
            left, right = ops.fill_binop(left, right, fill_value)
            return func(left, right)
    if ops.should_series_dispatch(self, other, func):
        new_data = ops.dispatch_to_series(self, other, _arith_op)
