def to_dict(self, orient="dict", into=dict):
    """
    Convert the DataFrame to a dictionary.

    The type of the key-value pairs can be customized with the parameters
    (see below).

    Parameters
    ----------
    orient : str {'dict', 'list', 'series', 'split', 'records', 'index'}
        Determines the type of the values of the dictionary.

        - 'dict' (default) : dict like {column -> {index -> value}}
        - 'list' : dict like {column -> [values]}
        - 'series' : dict like {column -> Series(values)}
        - 'split' : dict like
          {'index' -> [index], 'columns' -> [columns], 'data' -> [values]}
        - 'records' : list like
          [{column -> value}, ... , {column -> value}]
        - 'index' : dict like {index -> {column -> value}}

        Abbreviations are allowed. `s` indicates `series` and `sp`
        indicates `split`.

    into : class, default dict
        The collections.abc.Mapping subclass used for all Mappings
        in the return value.  Can be the actual class or an empty
        instance of the mapping type you want.  If you want a
        collections.defaultdict, you must pass it initialized.

    Returns
    -------
    dict, list or collections.abc.Mapping
        Return a collections.abc.Mapping object representing the DataFrame.
        The resulting transformation depends on the `orient` parameter.

    See Also
    --------
    DataFrame.from_dict: Create a DataFrame from a dictionary.
    DataFrame.to_json: Convert a DataFrame to JSON format.

    Examples
    --------
    >>> df = pd.DataFrame({'col1': [1, 2],
    ...                    'col2': [0.5, 0.75]},
    ...                   index=['row1', 'row2'])
    >>> df
          col1  col2
    row1     1  0.50
    row2     2  0.75
    >>> df.to_dict()
    {'col1': {'row1': 1, 'row2': 2}, 'col2': {'row1': 0.5, 'row2': 0.75}}

    You can specify the return orientation.

    >>> df.to_dict('series')
    {'col1': row1    1
             row2    2
    Name: col1, dtype: int64,
    'col2': row1    0.50
            row2    0.75
    Name: col2, dtype: float64}

    >>> df.to_dict('split')
    {'index': ['row1', 'row2'], 'columns': ['col1', 'col2'],
     'data': [[1, 0.5], [2, 0.75]]}

    >>> df.to_dict('records')
    [{'col1': 1, 'col2': 0.5}, {'col1': 2, 'col2': 0.75}]

    >>> df.to_dict('index')
    {'row1': {'col1': 1, 'col2': 0.5}, 'row2': {'col1': 2, 'col2': 0.75}}

    You can also specify the mapping type.

    >>> from collections import OrderedDict, defaultdict
    >>> df.to_dict(into=OrderedDict)
    OrderedDict([('col1', OrderedDict([('row1', 1), ('row2', 2)])),
                 ('col2', OrderedDict([('row1', 0.5), ('row2', 0.75)]))])

    If you want a `defaultdict`, you need to initialize it:

    >>> dd = defaultdict(list)
    >>> df.to_dict('records', into=dd)
    [defaultdict(<class 'list'>, {'col1': 1, 'col2': 0.5}),
     defaultdict(<class 'list'>, {'col1': 2, 'col2': 0.75})]
    """
    if not self.columns.is_unique:
        warnings.warn(
            "DataFrame columns are not unique, some columns will be omitted.",
            UserWarning,
            stacklevel=2,
        )
    # GH16122
    into_c = com.standardize_mapping(into)

    orient = orient.lower()
    # GH32515
    if orient.startswith(("d", "l", "s", "r", "i")) and orient not in {
        "dict",
        "list",
        "series",
        "split",
        "records",
        "index",
    }:
        warnings.warn(
            "Using short name for 'orient' is deprecated. Only the "
            "options: ('dict', list, 'series', 'split', 'records', 'index') "
            "will be used in a future version. Use one of the above "
            "to silence this warning.",
            FutureWarning,
        )

        if orient.startswith("d"):
            orient = "dict"
        elif orient.startswith("l"):
            orient = "list"
        elif orient.startswith("sp"):
            orient = "split"
        elif orient.startswith("s"):
            orient = "series"
        elif orient.startswith("r"):
            orient = "records"
        elif orient.startswith("i"):
            orient = "index"

    if orient == "dict":
        return into_c((k, v.to_dict(into)) for k, v in self.items())

    elif orient == "list":
        return into_c((k, v.tolist()) for k, v in self.items())

    elif orient == "split":
        return into_c(
            (
                ("index", self.index.tolist()),
                ("columns", self.columns.tolist()),
                (
                    "data",
                    [
                        list(map(com.maybe_box_datetimelike, t))
                        for t in self.itertuples(index=False, name=None)
                    ],
                ),
            )
        )

    elif orient == "series":
        return into_c((k, com.maybe_box_datetimelike(v)) for k, v in self.items())

    elif orient == "records":
        columns = self.columns.tolist()
        rows = (
            dict(zip(columns, row))
            for row in self.itertuples(index=False, name=None)
        )
        return [
            into_c((k, com.maybe_box_datetimelike(v)) for k, v in row.items())
            for row in rows
        ]

    elif orient == "index":
        if not self.index.is_unique:
            raise ValueError("DataFrame index must be unique for orient='index'.")
        return into_c(
            (t[0], dict(zip(self.columns, t[1:])))
            for t in self.itertuples(name=None)
        )

    else:
        raise ValueError(f"orient '{orient}' not understood")

@classmethod
def from_records(
    cls,
    data,
    index=None,
    exclude=None,
    columns=None,
    coerce_float=False,
    nrows=None,
) -> "DataFrame":
    """
    Convert structured or record ndarray to DataFrame.

    Parameters
    ----------
    data : ndarray (structured dtype), list of tuples, dict, or DataFrame
    index : str, list of fields, array-like
        Field of array to use as the index, alternately a specific set of
        input labels to use.
    exclude : sequence, default None
        Columns or fields to exclude.
    columns : sequence, default None
        Column names to use. If the passed data do not have names
        associated with them, this argument provides names for the
        columns. Otherwise this argument indicates the order of the columns
        in the result (any names not found in the data will become all-NA
        columns).
    coerce_float : bool, default False
        Attempt to convert values of non-string, non-numeric objects (like
        decimal.Decimal) to floating point, useful for SQL result sets.
    nrows : int, default None
        Number of rows to read if data is an iterator.

    Returns
    -------
    DataFrame
    """
    # Make a copy of the input columns so we can modify it
    if columns is not None:
        columns = ensure_index(columns)

    if is_iterator(data):
        if nrows == 0:
            return cls()

        try:
            first_row = next(data)
        except StopIteration:
            return cls(index=index, columns=columns)

        dtype = None
        if hasattr(first_row, "dtype") and first_row.dtype.names:
            dtype = first_row.dtype

        values = [first_row]

        if nrows is None:
            values += data
        else:
            values.extend(itertools.islice(data, nrows - 1))

        if dtype is not None:
            data = np.array(values, dtype=dtype)
        else:
            data = values

    if isinstance(data, dict):
        if columns is None:
            columns = arr_columns = ensure_index(sorted(data))
            arrays = [data[k] for k in columns]
        else:
            arrays = []
            arr_columns = []
            for k, v in data.items():
                if k in columns:
                    arr_columns.append(k)
                    arrays.append(v)

            arrays, arr_columns = reorder_arrays(arrays, arr_columns, columns)

    elif isinstance(data, (np.ndarray, DataFrame)):
        arrays, columns = to_arrays(data, columns)
        if columns is not None:
            columns = ensure_index(columns)
        arr_columns = columns
    else:
        arrays, arr_columns = to_arrays(data, columns, coerce_float=coerce_float)

        arr_columns = ensure_index(arr_columns)
        if columns is not None:
            columns = ensure_index(columns)
        else:
            columns = arr_columns

    if exclude is None:
        exclude = set()
    else:
        exclude = set(exclude)

    result_index = None
    if index is not None:
        if isinstance(index, str) or not hasattr(index, "__iter__"):
            i = columns.get_loc(index)
            exclude.add(index)
            if len(arrays) > 0:
                result_index = Index(arrays[i], name=index)
            else:
                result_index = Index([], name=index)
        else:
            try:
                index_data = [arrays[arr_columns.get_loc(field)] for field in index]
            except (KeyError, TypeError):
                # raised by get_loc, see GH#29258
                result_index = index
            else:
                result_index = ensure_index_from_sequences(index_data, names=index)
                exclude.update(index)

    if any(exclude):
        arr_exclude = [x for x in exclude if x in arr_columns]
        to_remove = [arr_columns.get_loc(col) for col in arr_exclude]
        arrays = [v for i, v in enumerate(arrays) if i not in to_remove]

        arr_columns = arr_columns.drop(arr_exclude)
        columns = columns.drop(exclude)

    mgr = arrays_to_mgr(arrays, arr_columns, result_index, columns)

    return cls(mgr)

@property
def T(self) -> "DataFrame":
    return self.transpose()

def _get_column_array(self, i: int) -> ArrayLike:
    """
    Get the values of the i'th column (ndarray or ExtensionArray, as stored
    in the Block)
    """
    return self._data.iget_values(i)

def __getitem__(self, key):
    key = lib.item_from_zerodim(key)
    key = com.apply_if_callable(key, self)

    if is_hashable(key):
        # shortcut if the key is in columns
        if self.columns.is_unique and key in self.columns:
            if self.columns.nlevels > 1:
                return self._getitem_multilevel(key)
            return self._get_item_cache(key)

    # Do we have a slicer (on rows)?
    indexer = convert_to_index_sliceable(self, key)
    if indexer is not None:
        # either we have a slice or we have a string that can be converted
        #  to a slice for partial-string date indexing
        return self._slice(indexer, axis=0)

    # Do we have a (boolean) DataFrame?
    if isinstance(key, DataFrame):
        return self.where(key)

    # Do we have a (boolean) 1d indexer?
    if com.is_bool_indexer(key):
        return self._getitem_bool_array(key)

    # We are left with two options: a single key, and a collection of keys,
    # We interpret tuples as collections only for non-MultiIndex
    is_single_key = isinstance(key, tuple) or not is_list_like(key)

    if is_single_key:
        if self.columns.nlevels > 1:
            return self._getitem_multilevel(key)
        indexer = self.columns.get_loc(key)
        if is_integer(indexer):
            indexer = [indexer]
    else:
        if is_iterator(key):
            key = list(key)
        indexer = self.loc._get_listlike_indexer(key, axis=1, raise_missing=True)[1]

    # take() does not accept boolean indexers
    if getattr(indexer, "dtype", None) == bool:
        indexer = np.where(indexer)[0]

    data = self._take_with_is_copy(indexer, axis=1)

    if is_single_key:
        # What does looking for a single key in a non-unique index return?
        # The behavior is inconsistent. It returns a Series, except when
        # - the key itself is repeated (test on data.shape, #9519), or
        # - we have a MultiIndex on columns (test on self.columns, #21309)
        if data.shape[1] == 1 and not isinstance(self.columns, ABCMultiIndex):
            data = data[key]

    return data

def _getitem_multilevel(self, key):
    # self.columns is a MultiIndex
    loc = self.columns.get_loc(key)
    if isinstance(loc, (slice, np.ndarray)):
        new_columns = self.columns[loc]
        result_columns = maybe_droplevels(new_columns, key)
        if self._is_mixed_type:
            result = self.reindex(columns=new_columns)
            result.columns = result_columns
        else:
            new_values = self.values[:, loc]
            result = self._constructor(
                new_values, index=self.index, columns=result_columns
            )
            result = result.__finalize__(self)

        # If there is only one column being returned, and its name is
        # either an empty string, or a tuple with an empty string as its
        # first element, then treat the empty string as a placeholder
        # and return the column as if the user had provided that empty
        # string in the key. If the result is a Series, exclude the
        # implied empty string from its name.
        if len(result.columns) == 1:
            top = result.columns[0]
            if isinstance(top, tuple):
                top = top[0]
            if top == "":
                result = result[""]
                if isinstance(result, Series):
                    result = self._constructor_sliced(
                        result, index=self.index, name=key
                    )

        result._set_is_copy(self)
        return result
    else:
        # loc is neither a slice nor ndarray, so must be an int
        return self._ixs(loc, axis=1)

def __setitem__(self, key, value):
    key = com.apply_if_callable(key, self)

    # see if we can slice the rows
    indexer = convert_to_index_sliceable(self, key)
    if indexer is not None:
        # either we have a slice or we have a string that can be converted
        #  to a slice for partial-string date indexing
        return self._setitem_slice(indexer, value)

    if isinstance(key, DataFrame) or getattr(key, "ndim", None) == 2:
        self._setitem_frame(key, value)
    elif isinstance(key, (Series, np.ndarray, list, Index)):
        self._setitem_array(key, value)
    else:
        # set column
        self._set_item(key, value)

def _setitem_array(self, key, value):
    # also raises Exception if object array with NA values
    if com.is_bool_indexer(key):
        if len(key) != len(self.index):
            raise ValueError(
                f"Item wrong length {len(key)} instead of {len(self.index)}!"
            )
        key = check_bool_indexer(self.index, key)
        indexer = key.nonzero()[0]
        self._check_setitem_copy()
        self.iloc._setitem_with_indexer(indexer, value)
    else:
        if isinstance(value, DataFrame):
            if len(value.columns) != len(key):
                raise ValueError("Columns must be same length as key")
            for k1, k2 in zip(key, value.columns):
                self[k1] = value[k2]
        else:
            self.loc._ensure_listlike_indexer(key, axis=1)
            indexer = self.loc._get_listlike_indexer(
                key, axis=1, raise_missing=False
            )[1]
            self._check_setitem_copy()
            self.iloc._setitem_with_indexer((slice(None), indexer), value)

def _setitem_frame(self, key, value):
    # support boolean setting with DataFrame input, e.g.
    # df[df > df2] = 0
    if isinstance(key, np.ndarray):
        if key.shape != self.shape:
            raise ValueError("Array conditional must be same shape as self")
        key = self._constructor(key, **self._construct_axes_dict())

    if key.values.size and not is_bool_dtype(key.values):
        raise TypeError(
            "Must pass DataFrame or 2-d ndarray with boolean values only"
        )

    self._check_inplace_setting(value)
    self._check_setitem_copy()
    self._where(-key, value, inplace=True)

def _ensure_valid_index(self, value):
    """
    Ensure that if we don't have an index, that we can create one from the
    passed value.
    """
    # GH5632, make sure that we are a Series convertible
    if not len(self.index) and is_list_like(value) and len(value):
        try:
            value = Series(value)
        except (ValueError, NotImplementedError, TypeError) as err:
            raise ValueError(
                "Cannot set a frame with no defined index "
                "and a value that cannot be converted to a Series"
            ) from err

        self._mgr = self._mgr.reindex_axis(
            value.index.copy(), axis=1, fill_value=np.nan
        )

def _sanitize_column(self, key, value, broadcast=True):
    """
    Ensures new columns (which go into the BlockManager as new blocks) are
    always copied and converted into an array.

    Parameters
    ----------
    key : object
    value : scalar, Series, or array-like
    broadcast : bool, default True
        If ``key`` matches multiple duplicate column names in the
        DataFrame, this parameter indicates whether ``value`` should be
        tiled so that the returned array contains a (duplicated) column for
        each occurrence of the key. If False, ``value`` will not be tiled.

    Returns
    -------
    numpy.ndarray
    """

    def reindexer(value):
        # reindex if necessary

        if value.index.equals(self.index) or not len(self.index):
            value = value._values.copy()
        else:

            # GH 4107
            try:
                value = value.reindex(self.index)._values
            except ValueError as err:
                # raised in MultiIndex.from_tuples, see test_insert_error_msmgs
                if not value.index.is_unique:
                    # duplicate axis
                    raise err

                # other
                raise TypeError(
                    "incompatible index of inserted column with frame index"
                ) from err
        return value

    if isinstance(value, Series):
        value = reindexer(value)

    elif isinstance(value, DataFrame):
        # align right-hand-side columns if self.columns
        # is multi-index and self[key] is a sub-frame
        if isinstance(self.columns, ABCMultiIndex) and key in self.columns:
            loc = self.columns.get_loc(key)
            if isinstance(loc, (slice, Series, np.ndarray, Index)):
                cols = maybe_droplevels(self.columns[loc], key)
                if len(cols) and not cols.equals(value.columns):
                    value = value.reindex(cols, axis=1)
        # now align rows
        value = reindexer(value).T

    elif isinstance(value, ExtensionArray):
        # Explicitly copy here, instead of in sanitize_index,
        # as sanitize_index won't copy an EA, even with copy=True
        value = value.copy()
        value = sanitize_index(value, self.index)

    elif isinstance(value, Index) or is_sequence(value):

        # turn me into an ndarray
        value = sanitize_index(value, self.index)
        if not isinstance(value, (np.ndarray, Index)):
            if isinstance(value, list) and len(value) > 0:
                value = maybe_convert_platform(value)
            else:
                value = com.asarray_tuplesafe(value)
        elif value.ndim == 2:
            value = value.copy().T
        elif isinstance(value, Index):
            value = value.copy(deep=True)
        else:
            value = value.copy()

        # possibly infer to datetimelike
        if is_object_dtype(value.dtype):
            value = maybe_infer_to_datetimelike(value)

    else:
        # cast ignores pandas dtypes. so save the dtype first
        infer_dtype, _ = infer_dtype_from_scalar(value, pandas_dtype=True)

        # upcast
        value = cast_scalar_to_array(len(self.index), value)
        value = maybe_cast_to_datetime(value, infer_dtype)

    # return internal types directly
    if is_extension_array_dtype(value):
        return value

    # broadcast across multiple columns if necessary
    if broadcast and key in self.columns and value.ndim == 1:
        if not self.columns.is_unique or isinstance(self.columns, ABCMultiIndex):
            existing_piece = self[key]
            if isinstance(existing_piece, DataFrame):
                value = np.tile(value, (len(existing_piece.columns), 1))

    return np.atleast_2d(np.asarray(value))

@property
def _series(self):
    return {
        item: Series(
            self._mgr.iget(idx), index=self.index, name=item, fastpath=True
        )
        for idx, item in enumerate(self.columns)
    }

def _reindex_axes(self, axes, level, limit, tolerance, method, fill_value, copy):
    frame = self

    columns = axes["columns"]
    if columns is not None:
        frame = frame._reindex_columns(
            columns, method, copy, level, fill_value, limit, tolerance
        )

    index = axes["index"]
    if index is not None:
        frame = frame._reindex_index(
            index, method, copy, level, fill_value, limit, tolerance
        )

    return frame

def _reindex_multi(self, axes, copy, fill_value) -> "DataFrame":
    """
    We are guaranteed non-Nones in the axes.
    """
    new_index, row_indexer = self.index.reindex(axes["index"])
    new_columns, col_indexer = self.columns.reindex(axes["columns"])

    if row_indexer is not None and col_indexer is not None:
        indexer = row_indexer, col_indexer
        new_values = algorithms.take_2d_multi(
            self.values, indexer, fill_value=fill_value
        )
        return self._constructor(new_values, index=new_index, columns=new_columns)
    else:
        return self._reindex_with_indexers(
            {0: [new_index, row_indexer], 1: [new_columns, col_indexer]},
            copy=copy,
            fill_value=fill_value,
        )

