def _join_compat(
    self, other, on=None, how="left", lsuffix="", rsuffix="", sort=False
):
    from pandas.core.reshape.merge import merge
    from pandas.core.reshape.concat import concat

    if isinstance(other, Series):
        if other.name is None:
            raise ValueError("Other Series must have a name")
        other = DataFrame({other.name: other})

    if isinstance(other, DataFrame):
        return merge(
            self,
            other,
            left_on=on,
            how=how,
            left_index=on is None,
            right_index=True,
            suffixes=(lsuffix, rsuffix),
            sort=sort,
        )
    else:
        if on is not None:
            raise ValueError(
                "Joining multiple DataFrames only supported for joining on index"
            )

        frames = [self] + list(other)

        can_concat = all(df.index.is_unique for df in frames)

        # join indexes only using concat
        if can_concat:
            if how == "left":
                res = concat(
                    frames, axis=1, join="outer", verify_integrity=True, sort=sort
                )
                return res.reindex(self.index, copy=False)
            else:
                return concat(
                    frames, axis=1, join=how, verify_integrity=True, sort=sort
                )

        joined = frames[0]

        for frame in frames[1:]:
            joined = merge(
                joined, frame, how=how, left_index=True, right_index=True
            )

        return joined

def _count_level(self, level, axis=0, numeric_only=False):
    if numeric_only:
        frame = self._get_numeric_data()
    else:
        frame = self

    count_axis = frame._get_axis(axis)
    agg_axis = frame._get_agg_axis(axis)

    if not isinstance(count_axis, ABCMultiIndex):
        raise TypeError(
            f"Can only count levels on hierarchical {self._get_axis_name(axis)}."
        )

    # Mask NaNs: Mask rows or columns where the index level is NaN, and all
    # values in the DataFrame that are NaN
    if frame._is_mixed_type:
        # Since we have mixed types, calling notna(frame.values) might
        # upcast everything to object
        values_mask = notna(frame).values
    else:
        # But use the speedup when we have homogeneous dtypes
        values_mask = notna(frame.values)

    index_mask = notna(count_axis.get_level_values(level=level))
    if axis == 1:
        mask = index_mask & values_mask
    else:
        mask = index_mask.reshape(-1, 1) & values_mask

    if isinstance(level, str):
        level = count_axis._get_level_number(level)

    level_name = count_axis._names[level]
    level_index = count_axis.levels[level]._shallow_copy(name=level_name)
    level_codes = ensure_int64(count_axis.codes[level])
    counts = lib.count_level_2d(mask, level_codes, len(level_index), axis=axis)

    if axis == 1:
        result = DataFrame(counts, index=agg_axis, columns=level_index)
    else:
        result = DataFrame(counts, index=level_index, columns=agg_axis)

    return result

def _reduce(
    self, op, name, axis=0, skipna=True, numeric_only=None, filter_type=None, **kwds
):

    assert filter_type is None or filter_type == "bool", filter_type

    dtype_is_dt = np.array(
        [
            is_datetime64_any_dtype(values.dtype)
            for values in self._iter_column_arrays()
        ],
        dtype=bool,
    )
    if numeric_only is None and name in ["mean", "median"] and dtype_is_dt.any():
        warnings.warn(
            "DataFrame.mean and DataFrame.median with numeric_only=None "
            "will include datetime64 and datetime64tz columns in a "
            "future version.",
            FutureWarning,
            stacklevel=3,
        )
        cols = self.columns[~dtype_is_dt]
        self = self[cols]

    if axis is None and filter_type == "bool":
        labels = None
        constructor = None
    else:
        # TODO: Make other agg func handle axis=None properly
        axis = self._get_axis_number(axis)
        labels = self._get_agg_axis(axis)
        constructor = self._constructor

    def f(x):
        return op(x, axis=axis, skipna=skipna, **kwds)

    def _get_data(axis_matters):
        if filter_type is None:
            data = self._get_numeric_data()
        elif filter_type == "bool":
            if axis_matters:
                # GH#25101, GH#24434
                data = self._get_bool_data() if axis == 0 else self
            else:
                data = self._get_bool_data()
        else:  # pragma: no cover
            msg = (
                f"Generating numeric_only data with filter_type {filter_type} "
                "not supported."
            )
            raise NotImplementedError(msg)
        return data

    if numeric_only is not None and axis in [0, 1]:
        df = self
        if numeric_only is True:
            df = _get_data(axis_matters=True)
        if axis == 1:
            df = df.T
            axis = 0

        out_dtype = "bool" if filter_type == "bool" else None

        def blk_func(values):
            if values.ndim == 1 and not isinstance(values, np.ndarray):
                # we can't pass axis=1
                return op(values, axis=0, skipna=skipna, **kwds)
            return op(values, axis=1, skipna=skipna, **kwds)

        # After possibly _get_data and transposing, we are now in the
        #  simple case where we can use BlockManager._reduce
        res = df._mgr.reduce(blk_func)
        assert isinstance(res, dict)
        if len(res):
            assert len(res) == max(list(res.keys())) + 1, res.keys()
        out = df._constructor_sliced(res, index=range(len(res)), dtype=out_dtype)
        out.index = df.columns
        if axis == 0 and df.dtypes.apply(needs_i8_conversion).any():
            # FIXME: needs_i8_conversion check is kludge, not sure
            #  why it is necessary in this case and this case alone
            out[:] = coerce_to_dtypes(out.values, df.dtypes)
        return out

    if not self._is_homogeneous_type:
        # try to avoid self.values call

        if filter_type is None and axis == 0 and len(self) > 0:
            # operate column-wise

            # numeric_only must be None here, as other cases caught above
            # require len(self) > 0 bc frame_apply messes up empty prod/sum

            # this can end up with a non-reduction
            # but not always. if the types are mixed
            # with datelike then need to make sure a series

            # we only end up here if we have not specified
            # numeric_only and yet we have tried a
            # column-by-column reduction, where we have mixed type.
            # So let's just do what we can
            from pandas.core.apply import frame_apply

            opa = frame_apply(
                self, func=f, result_type="expand", ignore_failures=True
            )
            result = opa.get_result()
            if result.ndim == self.ndim:
                result = result.iloc[0].rename(None)
            return result

    if numeric_only is None:
        data = self
        values = data.values

        try:
            result = f(values)

        except TypeError:
            # e.g. in nanops trying to convert strs to float

            # TODO: why doesnt axis matter here?
            data = _get_data(axis_matters=False)
            labels = data._get_agg_axis(axis)

            values = data.values
            with np.errstate(all="ignore"):
                result = f(values)

    else:
        if numeric_only:
            data = _get_data(axis_matters=True)
            labels = data._get_agg_axis(axis)

            values = data.values
        else:
            data = self
            values = data.values
        result = f(values)

    if filter_type == "bool" and is_object_dtype(values) and axis is None:
        # work around https://github.com/numpy/numpy/issues/10489
        # TODO: can we de-duplicate parts of this with the next blocK?
        result = np.bool_(result)
    elif hasattr(result, "dtype") and is_object_dtype(result.dtype):
        try:
            if filter_type is None:
                result = result.astype(np.float64)
            elif filter_type == "bool" and notna(result).all():
                result = result.astype(np.bool_)
        except (ValueError, TypeError):
            # try to coerce to the original dtypes item by item if we can
            if axis == 0:
                result = coerce_to_dtypes(result, data.dtypes)

    if constructor is not None:
        result = self._constructor_sliced(result, index=labels)
    return result

def _get_agg_axis(self, axis_num: int) -> Index:
    """
    Let's be explicit about this.
    """
    if axis_num == 0:
        return self.columns
    elif axis_num == 1:
        return self.index
    else:
        raise ValueError(f"Axis must be 0 or 1 (got {repr(axis_num)})")

@property
def _AXIS_NUMBERS(self) -> Dict[str, int]:
    """.. deprecated:: 1.1.0"""
    super()._AXIS_NUMBERS
    return {"index": 0, "columns": 1}

@property
def _AXIS_NAMES(self) -> Dict[int, str]:
    """.. deprecated:: 1.1.0"""
    super()._AXIS_NAMES
    return {0: "index", 1: "columns"}

def extract_unique_dtypes_from_dtypes_set(
    dtypes_set: FrozenSet[Dtype], unique_dtypes: np.ndarray
) -> List[Dtype]:
    extracted_dtypes = [
        unique_dtype
        for unique_dtype in unique_dtypes
        if issubclass(unique_dtype.type, tuple(dtypes_set))  # type: ignore
    ]
    return extracted_dtypes

def reindexer(value):
    # reindex if necessary

    if value.index.equals(self.index) or not len(self.index):
        value = value._values.copy()
    else:

        # GH 4107
        try:
            value = value.reindex(self.index)._values
        except ValueError as err:
            # raised in MultiIndex.from_tuples, see test_insert_error_msmgs
            if not value.index.is_unique:
                # duplicate axis
                raise err

            # other
            raise TypeError(
                "incompatible index of inserted column with frame index"
            ) from err
    return value

def _maybe_casted_values(index, labels=None):
    values = index._values
    if not isinstance(index, (PeriodIndex, DatetimeIndex)):
        if values.dtype == np.object_:
            values = lib.maybe_convert_objects(values)

    # if we have the labels, extract the values with a mask
    if labels is not None:
        mask = labels == -1

        # we can have situations where the whole mask is -1,
        # meaning there is nothing found in labels, so make all nan's
        if mask.all():
            values = np.empty(len(mask))
            values.fill(np.nan)
        else:
            values = values.take(labels)

            # TODO(https://github.com/pandas-dev/pandas/issues/24206)
            # Push this into maybe_upcast_putmask?
            # We can't pass EAs there right now. Looks a bit
            # complicated.
            # So we unbox the ndarray_values, op, re-box.
            values_type = type(values)
            values_dtype = values.dtype

            if issubclass(values_type, DatetimeLikeArray):
                values = values._data  # TODO: can we de-kludge yet?

            if mask.any():
                values, _ = maybe_upcast_putmask(values, mask, np.nan)

            if issubclass(values_type, DatetimeLikeArray):
                values = values_type(values, dtype=values_dtype)

    return values

def f(vals):
    labels, shape = algorithms.factorize(
        vals, size_hint=min(len(self), _SIZE_HINT_LIMIT)
    )
    return labels.astype("i8", copy=False), len(shape)

def extract_values(arr):
    # Does two things:
    # 1. maybe gets the values from the Series / Index
    # 2. convert datelike to i8
    if isinstance(arr, (ABCIndexClass, ABCSeries)):
        arr = arr._values

    if needs_i8_conversion(arr):
        if is_extension_array_dtype(arr.dtype):
            arr = arr.asi8
        else:
            arr = arr.view("i8")
    return arr

def combiner(x, y):
    mask = isna(x)
    if isinstance(mask, (ABCIndexClass, ABCSeries)):
        mask = mask._values

    x_values = extract_values(x)
    y_values = extract_values(y)

    # If the column y in other DataFrame is not in first DataFrame,
    # just return y_values.
    if y.name not in self.columns:
        return y_values

    return expressions.where(mask, y_values, x_values)

def infer(x):
    if x.empty:
        return lib.map_infer(x, func)
    return lib.map_infer(x.astype(object).values, func)

def _dict_round(df, decimals):
    for col, vals in df.items():
        try:
            yield _series_round(vals, decimals[col])
        except KeyError:
            yield vals

def _series_round(s, decimals):
    if is_integer_dtype(s) or is_float_dtype(s):
        return s.round(decimals)
    return s

def _get_data(axis_matters):
    if filter_type is None:
        data = self._get_numeric_data()
    elif filter_type == "bool":
        if axis_matters:
            # GH#25101, GH#24434
            data = self._get_bool_data() if axis == 0 else self
        else:
            data = self._get_bool_data()
    else:  # pragma: no cover
        msg = (
            f"Generating numeric_only data with filter_type {filter_type} "
            "not supported."
        )
        raise NotImplementedError(msg)
    return data

def _arith_op(left, right):
    # for the mixed_type case where we iterate over columns,
    # _arith_op(left, right) is equivalent to
    # left._binop(right, func, fill_value=fill_value)
    left, right = ops.fill_binop(left, right, fill_value)
    return func(left, right)

def blk_func(values):
    if values.ndim == 1 and not isinstance(values, np.ndarray):
        # we can't pass axis=1
        return op(values, axis=0, skipna=skipna, **kwds)
    return op(values, axis=1, skipna=skipna, **kwds)

